('2357','2','8328','Whg La Caixa',Null,'Grosszügige Meerblick Wohnung mit eigenem Pool, Nova Santa Ponsa','33199','Diese großzügige Wohnung hat ca 280m² Wohnfläche plus ca 220m² Terrassen mit eigenem Pool. Insgesamt gibt es 4 Schlafzimmer, 4 Badezimmer, Wohn-Esszimmer und Küche. Die Wohnung ist südlich ausgerichtet und hat einen fantastischen Blick auf  Port Adriano und das Meer.\r\nZu Ausstattung gehören Alu Doppelglasfenster und eine Klimaanlage w/k. Sie wird unmöbliert verkauft. Ein Garagenplatz kann eventuell angemietet oder gekauft werden\r\n','33200','1020000','106','2015-07-31 12:17:58','106','2015-07-31 12:18:15',Null,'2438','121','1146',1,'1','0',Null,Null,Null,'33201',Null,'0','0','0',Null,'2015-07-31 12:22:59',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33202',Null,'33203',Null,'33204',Null,'33205',Null,'33206','0',0,'6');
